('2409','2','8358','Dr. Bader',Null,'Meerblick Wohnung in Costa de la Calma zu verkaufen','33848','Costa de la Calma liegt in der Gemeinde Calvia und gehört zu den beliebtesten Wohnlagen im Südwesten Mallorcas. Die Wohnanlage ist südöstlich ausgerichtet. Die ca 120m² Wohnfläche verteilt sich auf Eingangsdiele, Wohn-Esszimmer mit offener Küche, Hauswirtschaftsraum, 1 Gäste Schlafzimmer, 1 Badezimmer und das Hauptschlafzimmer mit Bad en Suite und Zugang zur Terrasse. Die sehr gepflegte Wohnung ist ausgestattet mit Marmorfußboden, elektrische Rollläden, Klimaanlage w/k und Kaminkassette. Die ca 22 m² großen Terrasse bietet einen sehr schönen Panorama- Meerblick über die Küste der Costa de la Calma. Zur Wohnung gehört noch ein Autoabstellplatz in der Tiefgarage und ein ca 6m ² großen Abstellraum. Die Wohnung kann möbliert übernommen werden','33849','420000','106','2015-12-04 16:22:14','106','2015-12-04 16:23:16',Null,'2534','85','1190',1,'1','0',Null,Null,Null,'33850',Null,'0','0','0',Null,'2015-12-04 16:33:21',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33851',Null,'33852',Null,'33853',Null,'33854','630 222 754 wili','33855','0',0,'0');
